import uwLogo from '../../resources/color-UWcrest-print.png'

export default class Header extends React.PureComponent{
    render(){
        return(
            <div class={'flex-item'} style={{width: "100%", height: "10%",flex:1, flexDirection: 'column', textAlign: 'left', display:'flex'}}>
                <img src={uwLogo} style={{height: '1%', width: '2%', flex: 1}}></img>
                <text style={{fontFamily: 'Helvetica', fontSize: 60, paddingLeft: 20}}>
                    Max Johnson
                </text>
            </div>
        );
    }

    
}
